import React from 'react';
import Icon from './Icon';
import * as icons from '../Icons';
import Grid from '../Grid/Grid';
export default {
  title: 'Icon',
  component: Icon,
  parameters: {
    layout: 'centered'
  },
  tags: ['autodocs'],
  argTypes: {}
};
const IconComponent = () => <>
    <Grid container direction={'row'} justifyContent={'center'} alignItems={'center'} spacing={8}>
      {Object.keys(icons).map(key => {
      return <Grid item={1} key={key}>
            <span style={{
          fontSize: '10px',
          color: '#fff'
        }}>{key}</span>
            <Icon>{React.createElement(icons[key])}</Icon>
          </Grid>;
    })}
    </Grid>
  </>;
export const Docs = Story.bind({});
